import{_ as a,j as l,k as e,S as s}from"./chunks/framework.2ff57350.js";const o=JSON.parse('{"title":"emulator","description":"","frontmatter":{},"headers":[],"relativePath":"tools/emulator.md","filePath":"tools/emulator.md"}'),n={name:"tools/emulator.md"},t=[s('<h1 id="emulator" tabindex="-1">emulator <a class="header-anchor" href="#emulator" aria-label="Permalink to &quot;emulator&quot;">​</a></h1><p>Android 模拟器（emulator）是一个能够在电脑上模拟 Android 设备行为的工具，它可以让开发者在没有物理设备的情况下测试他们的应用程序。而 adb（Android Debug Bridge）则是一个用来连接和管理 Android 设备或模拟器的工具。</p><h2 id="使用-android-模拟器" tabindex="-1">使用 Android 模拟器 <a class="header-anchor" href="#使用-android-模拟器" aria-label="Permalink to &quot;使用 Android 模拟器&quot;">​</a></h2><ol><li><h5 id="下载并安装-android-studio。android-studio-是-android-开发的官方-ide-它包括了-android-sdk-和-android-模拟器等必须的工具。" tabindex="-1">下载并安装 Android Studio。Android Studio 是 Android 开发的官方 IDE，它包括了 Android SDK 和 Android 模拟器等必须的工具。 <a class="header-anchor" href="#下载并安装-android-studio。android-studio-是-android-开发的官方-ide-它包括了-android-sdk-和-android-模拟器等必须的工具。" aria-label="Permalink to &quot;下载并安装 Android Studio。Android Studio 是 Android 开发的官方 IDE，它包括了 Android SDK 和 Android 模拟器等必须的工具。&quot;">​</a></h5></li><li><h5 id="启动-android-studio-选择-avd-manager-选项来创建并管理模拟器。在这里-你可以选择选择一个预设的-android-设备或自定义一个模拟器。" tabindex="-1">启动 Android Studio，选择 &quot;AVD Manager&quot; 选项来创建并管理模拟器。在这里，你可以选择选择一个预设的 Android 设备或自定义一个模拟器。 <a class="header-anchor" href="#启动-android-studio-选择-avd-manager-选项来创建并管理模拟器。在这里-你可以选择选择一个预设的-android-设备或自定义一个模拟器。" aria-label="Permalink to &quot;启动 Android Studio，选择 &quot;AVD Manager&quot; 选项来创建并管理模拟器。在这里，你可以选择选择一个预设的 Android 设备或自定义一个模拟器。&quot;">​</a></h5></li><li><h5 id="启动模拟器并等待它完全启动。你可以通过运行以下命令来确保模拟器已经启动" tabindex="-1">启动模拟器并等待它完全启动。你可以通过运行以下命令来确保模拟器已经启动： <a class="header-anchor" href="#启动模拟器并等待它完全启动。你可以通过运行以下命令来确保模拟器已经启动" aria-label="Permalink to &quot;启动模拟器并等待它完全启动。你可以通过运行以下命令来确保模拟器已经启动：&quot;">​</a></h5></li></ol><div class="language-shell"><button title="Copy Code" class="copy"></button><span class="lang">shell</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">adb</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">devices</span></span></code></pre></div><p>如果你看到一个以 <code>emulator</code> 开头的设备列表，它就是你的 Android 模拟器。</p><ol start="4"><li><h5 id="下载并安装最新版的-android-sdk。" tabindex="-1">下载并安装最新版的 Android SDK。 <a class="header-anchor" href="#下载并安装最新版的-android-sdk。" aria-label="Permalink to &quot;下载并安装最新版的 Android SDK。&quot;">​</a></h5></li><li><h5 id="为你的模拟器执行端口转发。这是将模拟器的网络接口连接到电脑上的操作。你可以通过以下命令完成端口转发" tabindex="-1">为你的模拟器执行端口转发。这是将模拟器的网络接口连接到电脑上的操作。你可以通过以下命令完成端口转发： <a class="header-anchor" href="#为你的模拟器执行端口转发。这是将模拟器的网络接口连接到电脑上的操作。你可以通过以下命令完成端口转发" aria-label="Permalink to &quot;为你的模拟器执行端口转发。这是将模拟器的网络接口连接到电脑上的操作。你可以通过以下命令完成端口转发：&quot;">​</a></h5></li></ol><div class="language-shell"><button title="Copy Code" class="copy"></button><span class="lang">shell</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">adb</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">-s</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">emulator-5554</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">forward</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">tcp:8080</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">tcp:8080</span></span></code></pre></div><ol start="6"><li><h5 id="使用-adb-与模拟器交互。例如-你可以通过以下命令安装一个名为-app-apk-的应用程序" tabindex="-1">使用 adb 与模拟器交互。例如，你可以通过以下命令安装一个名为 &quot;app.apk&quot; 的应用程序： <a class="header-anchor" href="#使用-adb-与模拟器交互。例如-你可以通过以下命令安装一个名为-app-apk-的应用程序" aria-label="Permalink to &quot;使用 adb 与模拟器交互。例如，你可以通过以下命令安装一个名为 &quot;app.apk&quot; 的应用程序：&quot;">​</a></h5></li></ol><div class="language-shell"><button title="Copy Code" class="copy"></button><span class="lang">shell</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">adb</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">install</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">app.apk</span></span></code></pre></div><p>或者，你可以向模拟器发送一个按键事件：</p><div class="language-shell"><button title="Copy Code" class="copy"></button><span class="lang">shell</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">adb</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">shell</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">input</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">keyevent</span><span style="color:#A6ACCD;"> </span><span style="color:#F78C6C;">82</span></span></code></pre></div><h2 id="adb-介绍" tabindex="-1">ADB 介绍 <a class="header-anchor" href="#adb-介绍" aria-label="Permalink to &quot;ADB 介绍&quot;">​</a></h2><p>ADB，全称为 Android Debug Bridge，是一种用于连接和通信的命令行工具，可用于从计算机向手机发送命令、复制文件、安装/卸载应用程序、获取设备信息、执行 Shell 命令等操作。以下是 ADB 的详细使用方法和常用命令大全：</p><ol><li><h5 id="检查-adb-是否已安装成功-运行命令adb-version-如果-adp-已成功安装-则将显示-adb-的版本号。" tabindex="-1">检查 ADB 是否已安装成功：运行命令<code>adb version</code>，如果 ADP 已成功安装，则将显示 ADB 的版本号。 <a class="header-anchor" href="#检查-adb-是否已安装成功-运行命令adb-version-如果-adp-已成功安装-则将显示-adb-的版本号。" aria-label="Permalink to &quot;检查 ADB 是否已安装成功：运行命令`adb version`，如果 ADP 已成功安装，则将显示 ADB 的版本号。&quot;">​</a></h5></li><li><h5 id="打开-adb-调试模式-开启-android-手机的-usb-调试功能-连接到计算机后-运行命令adb-devices-则可以查看到连接到计算机的-android-设备。" tabindex="-1">打开 ADB 调试模式：开启 Android 手机的 USB 调试功能，连接到计算机后，运行命令<code>adb devices</code>，则可以查看到连接到计算机的 Android 设备。 <a class="header-anchor" href="#打开-adb-调试模式-开启-android-手机的-usb-调试功能-连接到计算机后-运行命令adb-devices-则可以查看到连接到计算机的-android-设备。" aria-label="Permalink to &quot;打开 ADB 调试模式：开启 Android 手机的 USB 调试功能，连接到计算机后，运行命令`adb devices`，则可以查看到连接到计算机的 Android 设备。&quot;">​</a></h5></li><li><h5 id="安装应用程序-运行命令adb-install-apkfile-apk-apkfile-apk-为应用程序的文件名-即可将应用程序安装到设备上。" tabindex="-1">安装应用程序：运行命令<code>adb install apkfile.apk</code>（apkfile.apk 为应用程序的文件名），即可将应用程序安装到设备上。 <a class="header-anchor" href="#安装应用程序-运行命令adb-install-apkfile-apk-apkfile-apk-为应用程序的文件名-即可将应用程序安装到设备上。" aria-label="Permalink to &quot;安装应用程序：运行命令`adb install apkfile.apk`（apkfile.apk 为应用程序的文件名），即可将应用程序安装到设备上。&quot;">​</a></h5></li><li><h5 id="卸载应用程序-运行命令adb-uninstall-package-name-package-name-为应用程序的包名-即可卸载应用程序。" tabindex="-1">卸载应用程序：运行命令<code>adb uninstall package_name</code>（package_name 为应用程序的包名），即可卸载应用程序。 <a class="header-anchor" href="#卸载应用程序-运行命令adb-uninstall-package-name-package-name-为应用程序的包名-即可卸载应用程序。" aria-label="Permalink to &quot;卸载应用程序：运行命令`adb uninstall package_name`（package_name 为应用程序的包名），即可卸载应用程序。&quot;">​</a></h5></li><li><h5 id="复制文件到设备-运行命令adb-push-local-file-remote-file-local-file-为本地待复制的文件-remote-file-为设备上的目标文件-即可将本地文件复制到设备上。" tabindex="-1">复制文件到设备：运行命令<code>adb push local_file remote_file</code>（local_file 为本地待复制的文件，remote_file 为设备上的目标文件），即可将本地文件复制到设备上。 <a class="header-anchor" href="#复制文件到设备-运行命令adb-push-local-file-remote-file-local-file-为本地待复制的文件-remote-file-为设备上的目标文件-即可将本地文件复制到设备上。" aria-label="Permalink to &quot;复制文件到设备：运行命令`adb push local_file remote_file`（local_file 为本地待复制的文件，remote_file 为设备上的目标文件），即可将本地文件复制到设备上。&quot;">​</a></h5></li><li><h5 id="复制文件到计算机-运行命令adb-pull-remote-file-local-file-remote-file-为设备上待复制的文件-local-file-为计算机上的目标文件-即可将设备上的文件复制到计算机上。" tabindex="-1">复制文件到计算机：运行命令<code>adb pull remote_file local_file</code>（remote_file 为设备上待复制的文件，local_file 为计算机上的目标文件），即可将设备上的文件复制到计算机上。 <a class="header-anchor" href="#复制文件到计算机-运行命令adb-pull-remote-file-local-file-remote-file-为设备上待复制的文件-local-file-为计算机上的目标文件-即可将设备上的文件复制到计算机上。" aria-label="Permalink to &quot;复制文件到计算机：运行命令`adb pull remote_file local_file`（remote_file 为设备上待复制的文件，local_file 为计算机上的目标文件），即可将设备上的文件复制到计算机上。&quot;">​</a></h5></li><li><h5 id="获取设备信息-运行命令adb-devices-即可查看连接到计算机的-android-设备-并显示其设备名称和设备-id-号。" tabindex="-1">获取设备信息：运行命令<code>adb devices</code>，即可查看连接到计算机的 Android 设备，并显示其设备名称和设备 ID 号。 <a class="header-anchor" href="#获取设备信息-运行命令adb-devices-即可查看连接到计算机的-android-设备-并显示其设备名称和设备-id-号。" aria-label="Permalink to &quot;获取设备信息：运行命令`adb devices`，即可查看连接到计算机的 Android 设备，并显示其设备名称和设备 ID 号。&quot;">​</a></h5></li><li><h5 id="查看设备状态-运行命令adb-get-state-即可查看设备的当前状态。" tabindex="-1">查看设备状态：运行命令<code>adb get-state</code>，即可查看设备的当前状态。 <a class="header-anchor" href="#查看设备状态-运行命令adb-get-state-即可查看设备的当前状态。" aria-label="Permalink to &quot;查看设备状态：运行命令`adb get-state`，即可查看设备的当前状态。&quot;">​</a></h5></li><li><h5 id="运行-shell-命令-运行命令adb-shell-即可进入设备的-shell-环境-可以在此环境下执行设备的命令。" tabindex="-1">运行 Shell 命令：运行命令<code>adb shell</code>，即可进入设备的 Shell 环境，可以在此环境下执行设备的命令。 <a class="header-anchor" href="#运行-shell-命令-运行命令adb-shell-即可进入设备的-shell-环境-可以在此环境下执行设备的命令。" aria-label="Permalink to &quot;运行 Shell 命令：运行命令`adb shell`，即可进入设备的 Shell 环境，可以在此环境下执行设备的命令。&quot;">​</a></h5></li><li><h5 id="查看设备日志-运行命令adb-logcat-即可查看设备上的日志信息。" tabindex="-1">查看设备日志：运行命令<code>adb logcat</code>，即可查看设备上的日志信息。 <a class="header-anchor" href="#查看设备日志-运行命令adb-logcat-即可查看设备上的日志信息。" aria-label="Permalink to &quot;查看设备日志：运行命令`adb logcat`，即可查看设备上的日志信息。&quot;">​</a></h5></li><li><h5 id="查看设备版本号-运行命令adb-shell-getprop-ro-build-version-release-即可查看设备的-android-版本号。" tabindex="-1">查看设备版本号：运行命令<code>adb shell getprop ro.build.version.release</code>，即可查看设备的 Android 版本号。 <a class="header-anchor" href="#查看设备版本号-运行命令adb-shell-getprop-ro-build-version-release-即可查看设备的-android-版本号。" aria-label="Permalink to &quot;查看设备版本号：运行命令`adb shell getprop ro.build.version.release`，即可查看设备的 Android 版本号。&quot;">​</a></h5></li><li><h5 id="查看设备-ip-地址-运行命令adb-shell-ifconfig-部分设备需运行adb-shell-netcfg-即可查看设备的-ip-地址。" tabindex="-1">查看设备 IP 地址：运行命令<code>adb shell ifconfig</code>（部分设备需运行<code>adb shell netcfg</code>），即可查看设备的 IP 地址。 <a class="header-anchor" href="#查看设备-ip-地址-运行命令adb-shell-ifconfig-部分设备需运行adb-shell-netcfg-即可查看设备的-ip-地址。" aria-label="Permalink to &quot;查看设备 IP 地址：运行命令`adb shell ifconfig`（部分设备需运行`adb shell netcfg`），即可查看设备的 IP 地址。&quot;">​</a></h5></li><li><h5 id="模拟按键操作-运行命令adb-shell-input-keyevent-keycode-num-keycode-num-为数字键的键值-即可模拟按下数字键操作。" tabindex="-1">模拟按键操作：运行命令<code>adb shell input keyevent KEYCODE_NUM</code>（KEYCODE_NUM 为数字键的键值），即可模拟按下数字键操作。 <a class="header-anchor" href="#模拟按键操作-运行命令adb-shell-input-keyevent-keycode-num-keycode-num-为数字键的键值-即可模拟按下数字键操作。" aria-label="Permalink to &quot;模拟按键操作：运行命令`adb shell input keyevent KEYCODE_NUM`（KEYCODE_NUM 为数字键的键值），即可模拟按下数字键操作。&quot;">​</a></h5></li><li><h5 id="模拟触屏操作-运行命令adb-shell-input-tap-x-y-x-和-y-为触屏上的坐标值-即可模拟触屏操作。" tabindex="-1">模拟触屏操作：运行命令<code>adb shell input tap x y</code>（x 和 y 为触屏上的坐标值），即可模拟触屏操作。 <a class="header-anchor" href="#模拟触屏操作-运行命令adb-shell-input-tap-x-y-x-和-y-为触屏上的坐标值-即可模拟触屏操作。" aria-label="Permalink to &quot;模拟触屏操作：运行命令`adb shell input tap x y`（x 和 y 为触屏上的坐标值），即可模拟触屏操作。&quot;">​</a></h5></li><li><h5 id="截图-运行命令adb-shell-screencap-p-sdcard-screenshot-png-即可将设备屏幕截图保存到指定目录下。" tabindex="-1">截图：运行命令<code>adb shell screencap -p /sdcard/screenshot.png</code>，即可将设备屏幕截图保存到指定目录下。 <a class="header-anchor" href="#截图-运行命令adb-shell-screencap-p-sdcard-screenshot-png-即可将设备屏幕截图保存到指定目录下。" aria-label="Permalink to &quot;截图：运行命令`adb shell screencap -p /sdcard/screenshot.png`，即可将设备屏幕截图保存到指定目录下。&quot;">​</a></h5></li><li><h5 id="录屏-运行命令adb-shell-screenrecord-sdcard-video-mp4-即可对设备进行屏幕录制-并将录制的视频保存到指定目录下。" tabindex="-1">录屏：运行命令<code>adb shell screenrecord /sdcard/video.mp4</code>，即可对设备进行屏幕录制，并将录制的视频保存到指定目录下。 <a class="header-anchor" href="#录屏-运行命令adb-shell-screenrecord-sdcard-video-mp4-即可对设备进行屏幕录制-并将录制的视频保存到指定目录下。" aria-label="Permalink to &quot;录屏：运行命令`adb shell screenrecord /sdcard/video.mp4`，即可对设备进行屏幕录制，并将录制的视频保存到指定目录下。&quot;">​</a></h5></li></ol><p>以上是 ADB 的常用命令和使用方法。</p><h2 id="ios-模拟器" tabindex="-1"><strong>ios 模拟器</strong> <a class="header-anchor" href="#ios-模拟器" aria-label="Permalink to &quot;**ios 模拟器**&quot;">​</a></h2><p>iOS 模拟器 Simulator 是苹果公司开发的一个软件，可以模拟真实的 iOS 设备环境，是开发和测试 iOS 应用程序的重要工具之一。</p><p>Simulator 允许开发者在计算机上运行 iOS 应用程序，以便在调试、测试和评估应用程序的功能和性能时进行快速迭代，而无需在实际设备上进行部署测试。Simulator 提供了几种不同的设备配置，包括各种不同的屏幕尺寸和操作系统版本，以帮助开发者在多种 iOS 设备上测试应用程序。</p><p>Simulator 可以模拟多种环境，如网络连接不佳，设备内存不足等，使开发者能够更好地预测和解决应用程序可能遇到的问题。</p><p>除了用于开发和测试 iOS 应用程序之外，Simulator 还可以用于演示和展示 iOS 应用程序，帮助用户更好地了解和理解应用程序的功能和交互流程。</p><p>总之，iOS 模拟器 Simulator 是一个非常有用的工具，能够帮助开发者加快应用程序的开发和测试速度，并提高应用程序质量和稳定性。</p><h3 id="simulator-常用的命令和使用方法的举例" tabindex="-1">Simulator 常用的命令和使用方法的举例： <a class="header-anchor" href="#simulator-常用的命令和使用方法的举例" aria-label="Permalink to &quot;Simulator 常用的命令和使用方法的举例：&quot;">​</a></h3><ol><li><h3 id="启动-simulator" tabindex="-1">启动 Simulator <a class="header-anchor" href="#启动-simulator" aria-label="Permalink to &quot;启动 Simulator&quot;">​</a></h3></li></ol><p>在命令行中输入以下命令启动 Simulator：</p><div class="language-shell"><button title="Copy Code" class="copy"></button><span class="lang">shell</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">open</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">/Applications/Xcode.app/Contents/Developer/Applications/Simulator.app</span></span></code></pre></div><ol start="2"><li><h3 id="选择模拟器" tabindex="-1">选择模拟器 <a class="header-anchor" href="#选择模拟器" aria-label="Permalink to &quot;选择模拟器&quot;">​</a></h3></li></ol><p>如果您安装了多个不同版本的 Xcode，可以使用以下命令选择要使用的模拟器：</p><div class="language-shell"><button title="Copy Code" class="copy"></button><span class="lang">shell</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">xcrun</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">simctl</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">list</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">devices</span></span></code></pre></div><p>该命令会列出所有可用的模拟器，您可以选择一个模拟器并输入以下命令启动：</p><div class="language-shell"><button title="Copy Code" class="copy"></button><span class="lang">shell</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">xcrun</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">simctl</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">boot</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">DEVICE-UDID</span></span></code></pre></div><p>其中，DEVICE-UDID 是模拟器的 UDID，可以在模拟器设置中找到。</p><ol start="3"><li><h3 id="安装应用程序" tabindex="-1">安装应用程序 <a class="header-anchor" href="#安装应用程序" aria-label="Permalink to &quot;安装应用程序&quot;">​</a></h3></li></ol><p>要在模拟器中安装应用程序，请使用以下命令：</p><div class="language-shell"><button title="Copy Code" class="copy"></button><span class="lang">shell</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">xcrun</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">simctl</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">install</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">DEVICE-UDID</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">/path/to/app.app</span></span></code></pre></div><p>其中，DEVICE-UDID 是模拟器的 UDID，/path/to/app.app 是应用程序的路径。</p><ol start="4"><li><h3 id="卸载应用程序" tabindex="-1">卸载应用程序 <a class="header-anchor" href="#卸载应用程序" aria-label="Permalink to &quot;卸载应用程序&quot;">​</a></h3></li></ol><p>要在模拟器中卸载应用程序，请使用以下命令：</p><div class="language-shell"><button title="Copy Code" class="copy"></button><span class="lang">shell</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">xcrun</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">simctl</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">uninstall</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">DEVICE-UDID</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">APP_IDENTIFIER</span></span></code></pre></div><p>其中，DEVICE-UDID 是模拟器的 UDID，APP_IDENTIFIER 是要卸载的应用程序的 Bundle Identifier。</p><ol start="5"><li><h3 id="模拟设备状态" tabindex="-1">模拟设备状态 <a class="header-anchor" href="#模拟设备状态" aria-label="Permalink to &quot;模拟设备状态&quot;">​</a></h3></li></ol><p>您可以使用以下命令模拟模拟器上的不同设备状态：</p><div class="language-shell"><button title="Copy Code" class="copy"></button><span class="lang">shell</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">xcrun</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">simctl</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">status_bar</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">DEVICE-UDID</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">override</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">--batteryLevel</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">BATTERY-LEVEL</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">--batteryState</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">BATTERY-STATE</span></span></code></pre></div><p>其中，DEVICE-UDID 是模拟器的 UDID，BATTERY-LEVEL 是电池电量级别（0-100），BATTERY-STATE 是电池状态（unplugged，charging，full）。</p><ol start="6"><li><h3 id="备份和恢复数据" tabindex="-1">备份和恢复数据 <a class="header-anchor" href="#备份和恢复数据" aria-label="Permalink to &quot;备份和恢复数据&quot;">​</a></h3></li></ol><p>您可以使用以下命令备份和恢复 Simulator 中的数据：</p><div class="language-shell"><button title="Copy Code" class="copy"></button><span class="lang">shell</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">xcrun</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">simctl</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">backup</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">DEVICE-UDID</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">~/Desktop/DEVICE-NAME.backup</span></span>\n<span class="line"><span style="color:#FFCB6B;">xcrun</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">simctl</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">erase</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">DEVICE-UDID</span></span>\n<span class="line"><span style="color:#FFCB6B;">xcodebuild</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">-project</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">PROJECT-NAME.xcodeproj</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">-scheme</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">SCHEME-NAME</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">-destination</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&#39;</span><span style="color:#C3E88D;">platform=iOS Simulator,name=DEVICE-NAME,OS=OS_VERSION test</span></span>\n<span class="line"><span style="color:#C3E88D;">xcrun simctl addmedia DEVICE-UDID /path/to/photo.jpg</span></span></code></pre></div><p>其中，DEVICE-UDID 是模拟器的 UDID，DEVICE-NAME 是备份名称，PROJECT-NAME 和 SCHEME-NAME 是要测试的应用程序的项目和模式名称，DEVICE-NAME 和 OS_VERSION 是模拟器的名称和操作系统版本，/path/to/photo.jpg 是要添加的媒体文件路径。</p><p>除了以上命令和使用方法外，Simulator 还有其他可用的命令和选项。您可以在终端中输入<code>man xcrun simctl</code>命令以查看完整的 Simulator 命令列表和文档。</p>',49)];const i=a(n,[["render",function(a,s,o,n,i,r){return l(),e("div",null,t)}]]);export{o as __pageData,i as default};
